import './App.css';
import { LoginPage } from './login';
import { Quizcustompage } from './quicklogin';
import {
	BrowserRouter as Router,
	Routes,
	Route
} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
       <routes>
       <Route exact path='/' element={<Quizcustompage />}></Route>
       <Routes exact path='/login' element={<LoginPage />}></Routes>
       </routes>

    </div>
    </Router>
  );
}

export default App;
